import { StyleSheet } from 'react-native';
import {Simulate} from "react-dom/test-utils";
import input = Simulate.input;

const styles = StyleSheet.create({
    container: {
        marginTop: 5,
    },
    input : {

    },
    searchInputs: {
        display: "flex",
    },
    dataResults: {

    },
    searchIcon: {
        height: 60,
        width: 50,
        backgroundColor: 'white',
        alignItems: "center"
    }
})

export default styles;
